import Sidebar from './Sidebar'; 
import { ReactNode } from 'react';

function Layout({ children }) {
  return (
    <div>
      <Sidebar />
      <Header />
      <main className="ml-[100px] pt-[64px] p-4">{children}</main>
    </div>
  );
}

export default Layout;
